var SSDEEP_BUFFER_PAGES = 8;
var SSDEEP_BUFFER_PROGRESS_IN_BYTES = 1048576;

var wasm = null;
var bufferMemoryStart = 0;
var memoryExpanded = false;
var digestPattern = /^([1-9][0-9]{0,9}:[0-9A-Za-z+\/]{0,64}:[0-9A-Za-z+\/]{0,64})(,.*)?$/;

function compareSingle(hashes)
{
	if (hashes.length != 2)
		throw "COMPARE_1 command argument is not valid.";
	var hash1 = hashes[0];
	var hash2 = hashes[1];
	var m1 = hash1.match(digestPattern);
	var m2 = hash2.match(digestPattern);
	if (!m1)
	{
		self.postMessage({type:"RUN1",data:{ret:-1,data:null,msg:"Hash 1 is not a valid digest."}});
		return;
	}
	if (!m2)
	{
		self.postMessage({type:"RUN1",data:{ret:-2,data:null,msg:"Hash 2 is not a valid digest."}});
		return;
	}
	hash1 = m1[1];
	hash2 = m2[1];
	var pbuf = wasm.instance.exports.fuzzy_wasm_get_temp_buffer();
	var psize = wasm.instance.exports.fuzzy_wasm_get_temp_buffer_slot_size();
	var pcount = wasm.instance.exports.fuzzy_wasm_get_temp_buffer_count();
	if (psize < 141) // maximum length string matching digestPattern is 140 (without trailing NUL).
		throw "fuzzy-wasm is compiled with wrong configuration (temporary buffer slot size).";
	if (pcount < 2)
		throw "fuzzy-wasm is compiled with wrong configuration (temporary buffer count).";
	var ary = new Uint8Array(psize * 2);
	for (var i = 0; i < hash1.length; i++)
	{
		// all characters are now in ASCII range
		ary[i] = hash1.charCodeAt(i);
	}
	for (var i = 0; i < hash2.length; i++)
	{
		// all characters are now in ASCII range
		ary[psize + i] = hash2.charCodeAt(i);
	}
	new Uint8Array(wasm.instance.exports.memory.buffer).set(ary, pbuf);
	var ret = wasm.instance.exports.fuzzy_compare(pbuf, pbuf+psize);
	if (ret < 0)
	{
		self.postMessage({type:"RUN1",data:{ret:-1,data:null,msg:"fuzzy_compare API call is failed."}});
		return;
	}
	self.postMessage({type:"RUN1",data:{ret:0,data:ret,msg:null}});
}

function hashFile(file)
{
	if (file.size > 206158430208) // 192GiB
	{
		self.postMessage({type:"RUN1",data:{ret:-1,data:null,msg:"Given file is too large to process."}});
		return;
	}
	if (!memoryExpanded)
	{
		wasm.instance.exports.memory.grow(SSDEEP_BUFFER_PAGES);
		memoryExpanded = true;
	}
	var bufferSize = 65536 * SSDEEP_BUFFER_PAGES;
	var fileSize = file.size;
	var nRepetition = (fileSize / bufferSize) | 0;
	if (fileSize % bufferSize != 0)
		nRepetition++;
	var progress = 0;
	var result = 0;
	var offset = 0;
	var remainingBytesForProgress = 0;
	wasm.instance.exports.fuzzy_new();
	result = wasm.instance.exports.fuzzy_set_total_input_length(fileSize & 0xffffffff, (fileSize / 0x100000000) | 0);
	if (result < 0)
	{
		// it should not happen here.
		self.postMessage({type:"RUN0",data:{ret:-1,data:null,msg:"fuzzy_set_total_input_length API call (somehow) failed."}});
		return;
	}
	var fileReader = new FileReaderSync();
	while (true)
	{
		var chunkLen = Math.min(fileSize - offset, bufferSize);
		var chunk = file.slice(offset, offset + chunkLen);
		var chunkBuffer = fileReader.readAsArrayBuffer(chunk);
		new Uint8Array(wasm.instance.exports.memory.buffer).set(new Uint8Array(chunkBuffer), bufferMemoryStart);
		result = wasm.instance.exports.fuzzy_update(bufferMemoryStart, chunkBuffer.byteLength);
		offset += chunkBuffer.byteLength;
		remainingBytesForProgress += chunkBuffer.byteLength;
		if (remainingBytesForProgress >= SSDEEP_BUFFER_PROGRESS_IN_BYTES)
		{
			self.postMessage({type:"PROG",data:{current:offset,total:fileSize}});
			remainingBytesForProgress %= SSDEEP_BUFFER_PROGRESS_IN_BYTES;
		}
		if (offset >= fileSize)
		{
			var pbuf = wasm.instance.exports.fuzzy_wasm_get_temp_buffer();
			var psize = wasm.instance.exports.fuzzy_wasm_get_temp_buffer_slot_size();
			result = wasm.instance.exports.fuzzy_digest(pbuf, 0);
			if (result < 0)
				self.postMessage({type:"RUN0",data:{ret:-1,data:null,msg:"fuzzy_digest API call (somehow) failed."}});
			else
			{
				var buf = new Uint8Array(wasm.instance.exports.memory.buffer).slice(pbuf, pbuf+psize);
				var len = buf.byteLength;
				var digest = "";
				for (var i = 0; i < len; i++)
				{
					if (buf[i] == 0)
						break;
					digest += String.fromCharCode(buf[i]);
				}
				var msg = null;
				if (fileSize < 4096)
					msg = "the signature may not be meaningful enough because given file is too small (<4KiB).";
				self.postMessage({type:"RUN1",data:{ret:0,data:digest,msg:msg}});
			}
			return;
		}
	}
}

